  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of the geologic contact
  lines for the Caldwell 7.5-minute Quadrangle.nn<br /><br />This polyline digital
  dataset, compiled through new detailed geologic mapping by the authors, represents
  the general distribution of geology for the Caldwell 7.5' quadrangle, Orange and
  Person Counties, North Carolina.  This polyline file was used to develop North Carolina
  Geological Survey Open-File Report 2010-03.  This file contains original North Carolina
  Geological Survey (NCGS) geologic mapping data generated by compiling detailed field
  observations during the period from August 2008 through June 2009 and September
  2009 through May 2010.  This polyline database delineates map units that are identified
  by general age and lithology through standard geologic mapping procedures.   These
  data were mapped at a scale of 1:24,000 and are appropriate for use at this scale
  and smaller.nnn<br /><br />Polylines are coded by line type (LINETYPE).nnThis dataset
  contains inferred and concealed contact lines.  This is the definition for the inferred
  polylines:nA polyline that indicates the interpreted geologic contact between map
  units, determined based on available station data.  A physical contact was not observed
  in the field.nThe concealed contact lines were obscured beneath the Quaternary alluvium.\",\n\t\"license_title\":
